  header () {
    const main = this.getElement('#content')
    const header = this.createElement('div', 'header')
    
    const headerTitle = this.createElement('h1', 'header__title')
    headerTitle.textContent = 'Weather App'
    
    header.append(headerTitle)
    main.append(header)
  }
  

